import { Avatar, Card } from "antd";

const UserProfile = () => {
    return (
        <Card
        >
            <Card.Meta
            avatar={<Avatar>
                ZC
            </Avatar>}
            title="sungoang"
            />
        </Card>
    )
};

export default UserProfile;
